(239, 74752519, 'Mention BETA, henüz bazı fonksiyonları tam olmayan, [u]site üzerine kurulabilir, yönetilebilir ve yayınlanabilir[/u] olan versiondur ve satışa çıkarılmıştır. BETA programına dahil olarak:\r\n[list=decimal]\r\n[li]Hataları direkt yapımcıya bildirebilirsiniz.[/li]\r\n[li]Yazılımda aklınıza gelen özelliği bildirebilirsiniz.[/li]\r\n[li][b][u]BETA programı kapsamında lisans aktarımı kesinlikle yasaktır.[/u][/b][/li]\r\n[li]Dosyalar açık edilemez, kaynak kodları sunulamaz.[/li]\r\n[li]Eklenti, tema oluşturup bunları ücretli/ücretsiz paylaşabilirsiniz.[/li]\r\n[li][u]Şablon düzenleme, kullanıcı yönetimi, eklenti yönetimi, genel site ayarları vs. bütün ana fonksiyonlar çalışır durumdadır![/u][/li]\r\n[/list]\r\nBETA yazılımında eksik olan bazı temel özellikler:\r\n[list=decimal]\r\n[li]Admin panelde, iletişim, araçlar ve kayıtlar kullanılamaz. [u]Bu fonksiyonlar sitenin kullanılmasında önemli yer teşkil etmez![/u][/li]\r\n[li][u]Install arayüzü yoktur.[/u][/li]\r\n[/list]\r\nSistemi kullanabileceğiniz hosting/server gereksinimleri:\r\n[list=decimal]\r\n[li]MySQL 5.5+[/li]\r\n[li]Gerekli PHP eklentileri: cURL, Iconv, DOM, JSON, SimpleXML, PDO[/li]\r\n[/list]', 1, 129, 1, 1, 1713198105, 1, 0, 1654564509, 1, '{\"client\":{\"type\":\"browser\",\"name\":\"Chrome\",\"short_name\":\"CH\",\"version\":\"102.0.5005.63\",\"engine\":\"Blink\",\"engine_version\":\"\",\"family\":\"Chrome\"},\"os\":{\"name\":\"Windows\",\"short_name\":\"WIN\",\"version\":\"10\",\"platform\":\"x64\",\"family\":\"Windows\"},\"device\":\"desktop\",\"model\":\"\"}'),
