(282, 92351408, '[code=php]<?php\r\n\r\n/**\r\n * This Abstract class use a App run on Object-Relational-Mapping.\r\n *\r\n * Utilized for ORM: Doctrine DBAL | https://www.doctrine-project.org/projects/doctrine-dbal/en/2.10/index.html\r\n */\r\n\r\nnamespace App\\Entity;\r\n\r\nuse App\\Repository\\Config\\Schema;\r\n\r\nuse Doctrine\\DBAL\\Configuration as DoctrineConfiguration;\r\nuse Doctrine\\DBAL\\DriverManager as DoctrineDriverManager;\r\nuse Doctrine\\DBAL\\Logging\\Middleware as DoctrineMiddleware;\r\nuse Doctrine\\DBAL\\Types\\Type as DoctrineTypes;\r\nuse Doctrine\\DBAL\\Schema\\Table as TableSchema;\r\n\r\nabstract class Mapper\r\n{\r\n	/**\r\n	 * [$table Current selected table]\r\n	 * @var [string]\r\n	 */\r\n	protected $table;\r\n\r\n	/**\r\n	 * logger\r\n	 * Doctrine logger\r\n	 * @var mixed\r\n	 */\r\n	protected $logger;\r\n\r\n	protected $conn;[/code]', 1, 129, 1, 1, 0, 0, 0, 1676577921, 0, '{\"client\":{\"type\":\"browser\",\"name\":\"Firefox\",\"short_name\":\"FF\",\"version\":\"109.0\",\"engine\":\"Gecko\",\"engine_version\":\"109.0\",\"family\":\"Firefox\"},\"os\":{\"name\":\"Windows\",\"short_name\":\"WIN\",\"version\":\"10\",\"platform\":\"x64\",\"family\":\"Windows\"},\"device\":\"desktop\",\"brand\":\"\",\"model\":\"\"}'),
(283, 11982568, '[spoiler=BB spoiler test]Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla erat ex, lacinia in cursus sed, venenatis sit amet mi. Fusce lacus tortor, eleifend lobortis diam ac, interdum hendrerit dolor. Suspendisse potenti. Praesent rhoncus ullamcorper massa, placerat rhoncus tellus convallis sit amet. Praesent volutpat orci ac nunc vehicula, tempor posuere justo ornare. Phasellus risus urna, imperdiet sit amet hendrerit a, maximus eu nulla. Pellentesque ac libero luctus, molestie urna ac, molestie urna. Vestibulum et libero eu neque varius molestie. Pellentesque ornare eget magna eget euismod. Cras et lobortis risus. In libero erat, tincidunt ac leo a, mollis vestibulum ipsum. Fusce tristique arcu nec dignissim tristique. Ut gravida ante at dignissim sollicitudin. Fusce eget mi rutrum, tincidunt eros vel, scelerisque quam. Sed pellentesque convallis quam sed gravida. Ut sollicitudin nisl enim, id elementum ipsum interdum sit amet.[/spoiler]', 1, 33, 1, 1, 0, 0, 0, 1676578197, 0, '{\"client\":{\"type\":\"browser\",\"name\":\"Firefox\",\"short_name\":\"FF\",\"version\":\"109.0\",\"engine\":\"Gecko\",\"engine_version\":\"109.0\",\"family\":\"Firefox\"},\"os\":{\"name\":\"Windows\",\"short_name\":\"WIN\",\"version\":\"10\",\"platform\":\"x64\",\"family\":\"Windows\"},\"device\":\"desktop\",\"brand\":\"\",\"model\":\"\"}'),
(284, 86484082, '[code=php]<?php\r\n\r\nnamespace Install\\Table;\r\n\r\nuse App\\Entity\\Mapper;\r\n\r\nclass Tables extends Mapper\r\n{\r\n    public function getTables()\r\n    {\r\n        $schema = $this->getSchemaManager();\r\n\r\n        $table = [];\r\n\r\n        $table[\'settings\'] = function ($table, $schema)\r\n        {\r\n            $table = $this->createTableSchema(\'settings\');\r\n\r\n            $schema->createTable($table);\r\n        };\r\n    }\r\n}\r\n[/code]', 1, 129, 1, 1, 1676581156, 1, 0, 1676581057, 0, '{\"client\":{\"type\":\"browser\",\"name\":\"Firefox\",\"short_name\":\"FF\",\"version\":\"109.0\",\"engine\":\"Gecko\",\"engine_version\":\"109.0\",\"family\":\"Firefox\"},\"os\":{\"name\":\"Windows\",\"short_name\":\"WIN\",\"version\":\"10\",\"platform\":\"x64\",\"family\":\"Windows\"},\"device\":\"desktop\",\"brand\":\"\",\"model\":\"\"}'),
